import {GET_PODCAST} from './actionTypes';
import axios from 'axios';

export const fetchPodcasts = () => async(dispatch) => {
  let podcasts;
  try {
   podcasts = await axios.get('/podcasts')
 }catch(e) {
   return console.log(e)
 }

dispatch({
  type: GET_PODCAST,
  payload: podcasts
});
};
